import React, { useState, useEffect } from 'react';

const EngineList = () => {
  const [engines, setEngines] = useState([]);

  useEffect(() => {
    async function fetchEngines() {
      try {
        const response = await fetch('http://localhost:3001/v1/api/engines');
        const data = await response.json();
        setEngines(data);
      } catch (error) {
        console.error('Error fetching engines:', error);
      }
    }

    fetchEngines();
  }, []);

  return (
    <div>
      <h2>Engine List</h2>
      <ul>
        {engines.map((engine) => (
          <li key={engine._id}>
            Type: {engine.type}, Horsepower: {engine.horsepower}, Fuel Type: {engine.fuelType}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default EngineList;
